import React from "react";
import "./Header.css";
import "./HorizontalneListe";
import HorizontalnaLista from "./HorizontalneListe";
import LargeButton from "./LargeButton";

function Header()
{
    const fontVel = "20px";
    return(
        <header>
            <div className="tekst">
                <HorizontalnaLista
                    prvi={<LargeButton value="#TECH" fontSize/>}
                />
            </div>
            <div className="ikone">
                <HorizontalnaLista
                    prvi={<LargeButton value="PROFILE"/>}
                    drugi={<LargeButton value="CART"/>}
                    treci={<LargeButton value="SHOP"/>}
                    cetvrti={<LargeButton value="LOG OUT"/>}
                />
            </div>
        </header>
    );
}

export default Header;
